import { Box, Button, TextField, Ty } from "@mui/material";
import React, { useState } from "react";
import './LoginForm.css'

const LoginForm = ({}) => {
    const [showNewUserContent, setShowNewUserContent] = useState(false);
    return (
        <div className='login-form'>
            <Box
                height={500}
                width={500}
                my={4}
                mx={55}
                display="flex"
                alignItems="center"
                gap={4}
                p={2}
                sx={{ 
                    border: '2px solid black', 
                    fontFamily: 'Times',
                    backgroundColor: "white",
                }}
            >
                <Typography
                     variant="h1"
                     alignItems="center"
                     sx={{
                         fontFamily: 'Times',
                        }}
                >
                    Buzz
                 </Typography>
                {!showNewUserContent && (
                    <div className='existing-user-content'>
                        <TextField  className='username-field' label='Username' variant='outlined'/>
                        <TextField  className='password-field' label='Password' variant='outlined'/>
                        <Button>Submit</Button>
                        <Button onClick={() => setShowNewUserContent(true)}>Not a user? Make an account</Button>
                    </div>
                )}
                {showNewUserContent && (
                    <div className='new-user-content'>
                        <TextField  className='name-field' label='Name' variant='outlined'/>
                        <TextField  className='username-field' label='Username' variant='outlined'/>
                        <TextField  className='password-field' label='Password' variant='outlined'/>
                        <Button>Submit</Button>
                    </div>
                )}
            </Box>
        </div>
    )
}

export default LoginForm;
